import * as React from 'react';
import { Link} from 'react-router-dom';
import './Card.css';

export interface ICardProps {
  link?: String;
  subtitle?: String;
}

export default class Card extends React.Component<ICardProps> {



  public render() {

    const children = this.props.subtitle?? 'Subtitle';
    const link = this.props.link ?? '/';

    return (
        <div className="card col p-0 2">
          <div className="card-body">
            <div className='row'>
              <div className='col-8'>
                <div className="statusNumber text-start">4</div>
                <div className="statusDesc text-muted text-start">{children}</div>
              </div>   
              <span className="col material-symbols-outlined">
                group
              </span>
            </div>
          </div>
          <Link to={`${link}`}>
            <div className="card-footer bg-primary text-white">
              Ver todos
            </div>
          </Link>
        </div>
    );
  }
}
